/*Table structure for table `article` */

DROP TABLE IF EXISTS `article`;

CREATE TABLE `article` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `title` varchar(511) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '文章题目',
  `author` varchar(20) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '作者名称',
  `content` longtext COLLATE utf8_bin COMMENT '内容',
  `type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '文章类型 0:开奖公告,1:政策法规,2:新闻资讯,3:常见问题,4:通知公告',
  `clink_num` int(10) NOT NULL DEFAULT '0' COMMENT '点击次数',
  `number` int(11) NOT NULL DEFAULT '0' COMMENT '期数(开奖公告有效)',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=73 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

