/*Table structure for table `banner` */

DROP TABLE IF EXISTS `banner`;

CREATE TABLE `banner` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `type` tinyint(2) NOT NULL DEFAULT '0' COMMENT 'Banner类型',
  `title` varchar(50) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '标题',
  `img_url` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT 'BannerUrl',
  `href` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '超链接地址',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

