/*Table structure for table `report` */

DROP TABLE IF EXISTS `report`;

CREATE TABLE `report` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '举报人姓名',
  `phone` varchar(11) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '举报人手机号',
  `be_reported_company_name` varchar(50) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '被举报企业名称',
  `be_reported_name` varchar(10) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '被举报者姓名',
  `be_reported_address` varchar(100) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '被举报人地址',
  `economic_nature` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '经济性质',
  `prove_information` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '证明信息',
  `content` varchar(511) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '举报内容',
  `img_url` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '图片地址',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

